import time
import tracemalloc
from termcolor import colored

class Solution:
    """
    2405. Optimal Partition of String - MEDIUM

    Given a string s, partition the string into one or more substrings such that the characters in each substring are unique. That is, no letter appears in a single substring more than once.

    Return the minimum number of substrings in such a partition.

    Note that each character should belong to exactly one substring in a partition.

    Example 1:

    Input: s = "abacaba"
    Output: 4
    Explanation:
    Two possible partitions are ("a","ba","cab","a") and ("ab","a","ca","ba").
    It can be shown that 4 is the minimum number of substrings needed.
    
    Example 2:

    Input: s = "ssssss"
    Output: 6
    Explanation:
    The only valid partition is ("s","s","s","s","s","s").
    """

    def __init__(self, s: str):
        """
        Initializes the Solution class with the string s.
        """
        self.s = s

    def __repr__(self):
        """
        Returns a string representation of the Solution class.
        """
        return f'Solution(s="{self.s}")'

    def optimalPartition_set(self) -> int:
        """
        Finds the minimum number of substrings in the partition such that the characters in each substring are unique.

        Returns
        -------
        int
            The minimum number of substrings in the partition.
        """
        # Initialize a set to keep track of seen characters
        seen = set()
        # Initialize the result to 1 since we need at least one partition
        result = 1
        
        # Iterate through each character in the string
        for char in self.s:
            # If the character is already in the seen set, start a new partition
            if char in seen:
                result += 1
                seen.clear()
            # Add the character to the seen set
            seen.add(char)
    
        return result
    
    def optimalPartition_bitmask(self) -> int:
        """
        Finds the minimum number of substrings in the partition such that
        the characters in each substring are unique.

        Returns
        -------
        int
            The minimum number of substrings in the partition.
        """
        # Initialize bitmask to keep track of seen characters
        seen = 0
        # Initialize the result to 1 since we need at least one partition
        result = 1

        # Iterate through each character in the string
        for char in self.s:
            # Calculate the bit number for the character
            # ord(char) - ord('a') gives the position of the character in the alphabet (0 for 'a', 1 for 'b', ..., 25 for 'z')
            # 1 << (ord(char) - ord('a')) creates a bitmask with a 1 at the position corresponding to the character
            bit = 1 << (ord(char) - ord('a'))
            # If the bit is already set in seen, it means the character has been seen in the current partition
            # seen & bit performs a bitwise AND operation between the seen bitmask and the bitmask for the current character
            # If the result is non-zero, it means the bit for the current character is already set in the seen bitmask
            if seen & bit:
                # Start a new partition
                result += 1
                # Reset the seen bitmask for the new partition
                seen = 0
            # Add the character to the seen bitmask by setting the corresponding bit
            # seen |= bit performs a bitwise OR operation between the seen bitmask and the bitmask for the current character
            # This sets the bit for the current character in the seen bitmask
            seen |= bit

        return result

    def optimalPartition_dfs(self) -> int:
        """
        This function uses DFS with memoization to find the minimum number of substrings
        needed such that each substring contains unique characters.
        """
        from functools import lru_cache

        @lru_cache(maxsize=None)
        def dfs(start):
            """
            This function uses Depth-First Search (DFS) with memoization to find the minimum number of substrings
            needed such that each substring contains unique characters.

            Parameters
            ----------
            start : int
                The starting index of the substring to be considered.

            Returns
            -------
            int
                The minimum number of substrings needed from the start index to the end of the string.
            """
            # Base case: If start index is beyond the end of the string, no more partitions are needed
            if start >= len(self.s):
                return 0

            # Initialize the minimum number of partitions to infinity
            min_partitions = float('inf')
            # Set to keep track of seen characters in the current substring
            seen_chars = set()
            
            # Iterate through the string starting from the 'start' index
            for end in range(start, len(self.s)):
                char = self.s[end]
                # If the character is already seen, break the loop to start a new partition
                if char in seen_chars:
                    break
                # Add the character to the seen set
                seen_chars.add(char)
                # Recursively find the minimum partitions needed from the next index
                partitions = 1 + dfs(end + 1)
                # Update the minimum partitions
                min_partitions = min(min_partitions, partitions)
            
            return min_partitions

        return dfs(0)
    
    def optimalPartition_bfs(self) -> int:
        """
        This function uses BFS to find the minimum number of substrings
        needed such that each substring contains unique characters.
        """
        from collections import deque

        def bfs():
            """
            Performs BFS to find the minimum number of partitions needed
            where each partition contains unique characters.
            """
            n = len(self.s)
            # Initialize the queue with the start index and partition count (1 initially)
            queue = deque([(0, 1)])  # Start from index 0 with one partition
            visited = set()

            while queue:
                current_index, partitions = queue.popleft()

                # If we have reached the end of the string, return the partition count
                if current_index >= n:
                    return partitions

                # If this index has already been visited, skip it
                if current_index in visited:
                    continue
                visited.add(current_index)

                # Use a set to keep track of characters in the current partition
                seen = set()

                # Extend the current partition by adding characters until a duplicate is found
                for i in range(current_index, n):
                    char = self.s[i]
                    if char in seen:
                        # If a duplicate character is found, start a new partition from this index
                        queue.append((i, partitions + 1))
                        break
                    # Otherwise, add the character to the seen set
                    seen.add(char)

                # Consider moving to the next character without breaking the partition
                queue.append((current_index + 1, partitions))

            # If no valid partitioning is found, return infinity
            return float('inf')

        # Start BFS from index 0
        return bfs()

    
    def optimalPartition_iterative(self) -> int:
        """
        This function uses an iterative approach with a stack to simulate DFS and find
        the minimum number of substrings needed such that each substring contains unique characters.
        """
        from functools import lru_cache

        n = len(self.s)
        dp = [float('inf')] * (n + 1)  # dp[i] will store the minimum partitions needed from index i to the end
        dp[n] = 0  # Base case: no partitions needed beyond the end of the string

        # Iterate from the end of the string to the start
        for start in range(n - 1, -1, -1):
            seen_chars = set()
            # Try to partition the substring [start:end]
            for end in range(start, n):
                if self.s[end] in seen_chars:
                    break  # Break on duplicate character to start a new partition
                seen_chars.add(self.s[end])
                # Update dp[start] as the minimum of its current value and 1 + dp[end + 1]
                dp[start] = min(dp[start], 1 + dp[end + 1])

        # The answer is the minimum partitions needed from the start of the string
        return dp[0]


if __name__ == "__main__":
    def benchmark(func, *args):
        tracemalloc.start()
        start_time = time.time()
        result = func(*args)
        end_time = time.time()
        current, peak = tracemalloc.get_traced_memory()
        tracemalloc.stop()
        return result, end_time - start_time, current, peak

    test_cases = [
    "abacaba",
    "ssssss",
    # "",
    # Edge test cases
    "",
    "a",
    "aa",
    "abcdefghijklmnopqrstuvwxyz",
]

implementations = {
    "Optimal Partition DFS": "optimalPartition_dfs",
    "Optimal Partition Set": "optimalPartition_set",
    "Optimal Partition Bitmask": "optimalPartition_bitmask",
    "Optimal Partition BFS": "optimalPartition_bfs",
    "Optimal Partition Iterative": "optimalPartition_iterative",
}

for string in test_cases:
    solution = Solution(string)
    print(colored('-' * 100, 'red'))
    print(colored(f"Testing string: '{string}'", 'yellow'))
    
    for name, method_name in implementations.items():
        print(colored('-' * 100, 'red'))
        print(colored(name, 'blue'))
        method = getattr(solution, method_name)
        result, exec_time, current, peak = benchmark(method)
        print(colored(
            f"Result: {result}, Time: {exec_time:.6f}s, "
            f"Current Memory: {current / 10**6:.6f}MB, "
            f"Peak Memory: {peak / 10**6:.6f}MB",
            'green'
        ))
    print(colored('-' * 100, 'red'))